import HorizonLine from "../horizontal";

export default function ServerTime({text}) {
  return (
    <div style={{ 
      display: "inline-block", 
      width: "256px", 
      height: "97px", 
      border: "1px solid #70BB53",
      marginTop: "15px",
      borderRadius: "8px", 
      backgroundColor: "#ffffff",
    }}>
      <span style={{ 
        margin: "10px", // 여백 추가
      }}>서버 시간:{text}</span>
      <HorizonLine />
    </div>
  );
}
